--
-- Name: v_chatbot_complete; Type: VIEW; Schema: public; Owner: gatorade_user
--

CREATE VIEW public.v_chatbot_complete AS
 SELECT r.id AS result_id,
    s.store_name,
    s.store_code_sellin,
    s.store_code_sellout,
    c.city_name,
    t.typology_name,
    l.lever_name,
    cat.category_name,
    u.unit_name,
    ds.source_name,
    p.period_label,
    p.period_type,
    p.start_date,
    p.end_date,
    r.value,
    r.created_at
   FROM ((((((((public.ab_test_result r
     JOIN public.store_master s ON ((r.store_id = s.id)))
     JOIN public.city_master c ON ((s.city_id = c.city_id)))
     JOIN public.typology_master t ON ((s.typology_id = t.typology_id)))
     JOIN public.lever_master l ON ((s.lever_id = l.lever_id)))
     JOIN public.category_master cat ON ((r.category_id = cat.category_id)))
     JOIN public.measurement_unit_master u ON ((r.unit_id = u.unit_id)))
     JOIN public.data_source_master ds ON ((r.source_id = ds.source_id)))
     JOIN public.period_master p ON ((r.period_id = p.period_id)))
  WHERE (s.is_active = true);


